import{_ as t,c as a,o,ag as i}from"./chunks/framework.DRADY2L-.js";const n="/assets/logo.DKjuK0cp.png",r="/assets/title_menu.Bn91akCW.png",l="/assets/ram_guide_mmc.CElJg6TU.png",s="/assets/ram_guide_vanilla_1.HSr3RF1a.png",d="/assets/ram_guide_vanilla_2.BbRQ2xnR.png",h="/assets/ram_guide_vanilla_3.BNz-Xa34.png",c="/assets/gpu_guide.CI-o3h5J.png",u="/assets/chunk_multidraw.HZWK3Apk.png",p="/assets/latest_log.C2gG5TTJ.png",m="/assets/javacheck.BU_XZYWK.png",M=JSON.parse('{"title":"Setup","description":"","frontmatter":{},"headers":[],"relativePath":"install/faq.md","filePath":"install/faq.md","lastUpdated":1757431905000}'),f={name:"install/faq.md"};function g(y,e,b,k,w,v){return o(),a("div",null,[...e[0]||(e[0]=[i('<div style="text-align:center;"><img src="'+n+'" alt="Logo" width="200" style="display:block;margin:0 auto;"></div><p>Check the table of contents on the right, or just Ctrl-F, to search through this document.</p><p>This document will focus on issues affecting Prism Launcher, MultiMC and other launchers, but you’re strongly advised to use Prism or MultiMC.</p><p>Credit to Ataraxia for writing the original version of this document.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>💬 Having issues? Feel free to ask in our <a href="https://mcsrranked.com/discord" target="_blank" rel="noreferrer">Discord server</a> in the <code>#tech-help</code> channel.</p></div><h1 id="setup" tabindex="-1">Setup <a class="header-anchor" href="#setup" aria-label="Permalink to &quot;Setup&quot;">​</a></h1><h2 id="where-can-i-find-information-about-ranked" tabindex="-1">Where can I find information about Ranked? <a class="header-anchor" href="#where-can-i-find-information-about-ranked" aria-label="Permalink to &quot;Where can I find information about Ranked?&quot;">​</a></h2><ul><li>Website: <a href="https://mcsrranked.com/" target="_blank" rel="noreferrer">https://mcsrranked.com/</a></li><li>Discord: <a href="https://discord.gg/nnjUSyDErj" target="_blank" rel="noreferrer">https://discord.gg/nnjUSyDErj</a></li><li>Mod download: <a href="https://modrinth.com/mod/mcsr-ranked/version/latest" target="_blank" rel="noreferrer">https://modrinth.com/mod/mcsr-ranked/version/latest</a><ul><li>Since most speedrunners run on Minecraft 1.16.1, this mod is developed for 1.16.1. It will not work in other versions of Minecraft.</li></ul></li><li>The ranked menu looks like this in-game:</li></ul><p><img src="'+r+'" alt=""></p><h2 id="how-do-i-set-up-ranked" tabindex="-1">How do I set up Ranked? <a class="header-anchor" href="#how-do-i-set-up-ranked" aria-label="Permalink to &quot;How do I set up Ranked?&quot;">​</a></h2><p>See <a href="./index">the installation guide</a> for instructions.</p><h2 id="i-have-the-mods-but-they-don-t-show-up-in-game-i-don-t-see-the-ranked-button" tabindex="-1">I have the mods but they don’t show up in-game (I don’t see the ranked button) <a class="header-anchor" href="#i-have-the-mods-but-they-don-t-show-up-in-game-i-don-t-see-the-ranked-button" aria-label="Permalink to &quot;I have the mods but they don’t show up in-game (I don’t see the ranked button)&quot;">​</a></h2><p>You need to install Fabric.</p><p>If you’re using Prism Launcher:</p><ul><li>Select your instance &gt; Edit &gt; Install Loader &gt; Fabric.</li></ul><p>If you’re using MultiMC:</p><ul><li>Select your instance &gt; Edit Instance &gt; Install Fabric.</li></ul><p>If you’re using the default launcher:</p><ul><li>Follow the instructions <a href="https://fabricmc.net/wiki/player:tutorials:install_mcl:windows" target="_blank" rel="noreferrer">here</a>, up to Step 3. Do not install Fabric API.</li></ul><h2 id="update-java" tabindex="-1">How do I update my Java version? <a class="header-anchor" href="#update-java" aria-label="Permalink to &quot;How do I update my Java version? {#update-java}&quot;">​</a></h2><ul><li>for Prism: follow <a href="https://gist.github.com/maskersss/0993754fb91686f78f8c000280699fa4" target="_blank" rel="noreferrer">this guide</a></li><li>for MultiMC / official launcher: follow the relevant section of <a href="https://docs.google.com/document/d/1PIjyPMulI3r5aZpfywt5OQR_12qEzX5UTfU8DQHtNp8/edit?pli=1&amp;tab=t.0#heading=h.62ygxgaxcs5a" target="_blank" rel="noreferrer">this guide</a></li></ul><h2 id="the-ranked-button-is-greyed-out-and-unclickable-hovering-over-it-shows-a-tooltip" tabindex="-1">The ranked button is greyed out and unclickable, hovering over it shows a “...” tooltip <a class="header-anchor" href="#the-ranked-button-is-greyed-out-and-unclickable-hovering-over-it-shows-a-tooltip" aria-label="Permalink to &quot;The ranked button is greyed out and unclickable, hovering over it shows a “...” tooltip&quot;">​</a></h2><ul><li>First, check if the ranked server is down (check #maintenances in the discord server).</li><li>If it isn&#39;t down, check that the version of your ranked mod matches the latest release. Navigate to <a href="#find-minecraft">your mods folder</a> and check the version number of the <code>mcsrranked</code> mod, comparing it to the <a href="https://modrinth.com/mod/mcsr-ranked/version/latest" target="_blank" rel="noreferrer">latest version</a>. If they don’t match, replace your outdated mod with the latest version.</li><li>Lastly, something on your end (network, firewall, antivirus, etc.) might be blocking the ranked mod from working. See <a href="#unknownhostexception">UnknownHostException</a> for potential fixes.</li></ul><h2 id="when-i-click-the-ranked-button-i-get-error-connection-timed-out" tabindex="-1">When I click the ranked button, I get “ERROR: Connection timed out” <a class="header-anchor" href="#when-i-click-the-ranked-button-i-get-error-connection-timed-out" aria-label="Permalink to &quot;When I click the ranked button, I get “ERROR: Connection timed out”&quot;">​</a></h2><p>See <a href="#unknownhostexception">UnknownHostException</a>.</p><h2 id="when-i-click-the-ranked-button-it-says-player-authentication-data-couldn-t-be-loaded-from-minecraft-auth-api" tabindex="-1">When I click the ranked button, it says “Player authentication data couldn’t be loaded from Minecraft Auth API” <a class="header-anchor" href="#when-i-click-the-ranked-button-it-says-player-authentication-data-couldn-t-be-loaded-from-minecraft-auth-api" aria-label="Permalink to &quot;When I click the ranked button, it says “Player authentication data couldn’t be loaded from Minecraft Auth API”&quot;">​</a></h2><p>If you’re on Prism/MultiMC:</p><ul><li>Close the game. In the launcher, select your account name (top-right of launcher), click “Manage accounts”, right-click your account and select “Refresh”.</li></ul><p>If you’re on another launcher:</p><ul><li>Close the game and try restarting your launcher. If you still get the same error, sign out and sign in to the launcher.</li></ul><p>If you’re on a cracked launcher:</p><ul><li>You need a <a href="https://www.minecraft.net/" target="_blank" rel="noreferrer">Minecraft account</a> to play Ranked, since Ranked requires your player UUID.</li></ul><h2 id="my-game-fails-to-launch" tabindex="-1">My game fails to launch <a class="header-anchor" href="#my-game-fails-to-launch" aria-label="Permalink to &quot;My game fails to launch&quot;">​</a></h2><p>You can browse through <a href="#crashes">Crashes</a> to find the issue you’re having, but if you’re not sure or it’s too much to look through, see the guide at the top of <a href="#crashes">Crashes</a> which will show you what files you’d need to send in #tech-help, so that others can help diagnose your issue.</p><h2 id="find-minecraft" tabindex="-1">Where do I find my .minecraft folder / mods folder? <a class="header-anchor" href="#find-minecraft" aria-label="Permalink to &quot;Where do I find my .minecraft folder / mods folder? {#find-minecraft}&quot;">​</a></h2><p>If you&#39;re on Prism:</p><ul><li>Select your instance and click &quot;Folder&quot;. Navigate to <code>minecraft/</code> or to <code>minecraft/mods/</code>.</li></ul><p>If you’re on MultiMC:</p><ul><li>Select your instance and click “Minecraft Folder” to open your .minecraft folder, or “View Mods” to view your mods.</li></ul><p>If you’re on the default launcher (Windows):</p><ul><li>Hold the Windows key and press R. Type in <code>%appdata%</code> and press Enter, then go into <code>.minecraft</code>. The <code>mods</code> folder is located within <code>.minecraft</code>.</li></ul><p>If you’re on the default launcher (macOS):</p><ul><li>Go to <code>/Library/Application Support/minecraft</code>. <ul><li>If you can’t find this folder, enable <a href="https://nordlocker.com/blog/how-to-show-hidden-files-mac/" target="_blank" rel="noreferrer">Show hidden files</a>.</li></ul></li></ul><h2 id="how-do-i-increase-my-brightness-gamma" tabindex="-1">How do I increase my brightness/gamma? <a class="header-anchor" href="#how-do-i-increase-my-brightness-gamma" aria-label="Permalink to &quot;How do I increase my brightness/gamma?&quot;">​</a></h2><p>If you&#39;re using the latest version of Sodium, you can adjust the brightness level up to 500% via Options &gt; Video Settings <u>from the title screen</u>.</p><p>Otherwise, go to your <a href="#find-minecraft">.minecraft folder</a>, open options.txt and change the value next to gamma to 5.0. This is the highest value allowed for speedrunning.</p><h2 id="allocate-ram" tabindex="-1">How do I allocate more RAM to Minecraft? <a class="header-anchor" href="#allocate-ram" aria-label="Permalink to &quot;How do I allocate more RAM to Minecraft? {#allocate-ram}&quot;">​</a></h2><p>If you’re on Prism or MultiMC:</p><ul><li>Go to Settings &gt; Java and set the maximum memory allocation to somewhere around 3000.</li></ul><div style="text-align:center;"><img src="'+l+'" alt="Logo" style="display:block;margin:0 auto;"></div><p>If you’re on the default launcher (though the default RAM allocation is fine):</p><ol><li>Go to Installations, find the installation you’re using and click the “...” button. Click “Edit”.</li></ol><div style="text-align:center;"><img src="'+s+'" alt="Logo" style="display:block;margin:0 auto;"></div><ol><li>Click “More Options”, then adjust the number after -Xmx. <ul><li>You can change “G” to “M” to edit in terms of MB instead of GB.</li></ul></li></ol><div style="text-align:center;"><img src="'+d+'" alt="Logo" style="display:block;margin:0 auto;"><br><img src="'+h+'" alt="Logo" style="display:block;margin:0 auto;"></div><p>Do not allocate too much RAM since <a href="https://vazkii.net/blog_archive/%22%20%5Cl%20%22blog/ram-explanation" target="_blank" rel="noreferrer">it may cause lag spikes</a>.</p><h2 id="use-dgpu" tabindex="-1">How do I get Minecraft to use my high-performance GPU? <a class="header-anchor" href="#use-dgpu" aria-label="Permalink to &quot;How do I get Minecraft to use my high-performance GPU? {#use-dgpu}&quot;">​</a></h2><p>On Windows:</p><ol><li>Press the Start button and type “Graphics settings”. Under Graphics performance preference, click “Browse”.</li></ol><div style="text-align:center;"><img src="'+c+'" alt="Logo" style="display:block;margin:0 auto;"></div><ol start="2"><li>Select the javaw.exe that Minecraft is using, and set it to “High performance”.</li></ol><p>If you don’t know where to find javaw.exe,</p><p>If you’re on Prism/MultiMC:</p><ul><li>Go to Edit (instance) &gt; Settings &gt; Java, and copy the path in “Java path”.</li></ul><p>If you’re on the default launcher:</p><ul><li>Go to Installations, find the installation you’re using and click the “...” button. Click “Edit”, then “More Options”. Copy the path in “Java executable”.</li></ul><p>Alternatively, you can follow steps 1-5 of <a href="https://obsproject.com/kb/minecraft-java-edition-troubleshooting" target="_blank" rel="noreferrer">this guide</a>.</p><h2 id="i-have-worse-performance-than-expected" tabindex="-1">I have worse performance than expected <a class="header-anchor" href="#i-have-worse-performance-than-expected" aria-label="Permalink to &quot;I have worse performance than expected&quot;">​</a></h2><p>This is usually caused by one or more of the following issues:</p><ul><li><a href="#allocate-ram">Not allocating enough RAM</a></li><li><a href="#update-java">Using the bundled Java runtime</a></li><li><a href="#use-dgpu">Using the integrated GPU</a> (if you have multiple GPUs) for the Java version you’re using</li></ul><h2 id="how-do-i-add-custom-commands-like-elo-on-twitch" tabindex="-1">How do I add custom commands like <code>!elo</code> on Twitch? <a class="header-anchor" href="#how-do-i-add-custom-commands-like-elo-on-twitch" aria-label="Permalink to &quot;How do I add custom commands like `!elo` on Twitch?&quot;">​</a></h2><p>OshBot has some commands for Ranked like <code>+elo</code>, see <a href="https://bot.osh.gay/ranked/elo" target="_blank" rel="noreferrer">its documentation</a>.</p><p>Additionally, there are some commands for Fossabot / Nightbot:</p><ul><li>(Fossabot) <code>!today</code> (replace MC_USERNAME with your minecraft username) - made by memerson</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>$(eval r=$(customapi https://mcsr-stats.memerson.xyz/api/matches?timeframe=$(urlencode $(uptime))&amp;username=MC_USERNAME); r[&#39;error&#39;] ? `${r[&#39;error&#39;]}` : `$(channel.display_name)&#39;s stats since stream start - Elo: ${r[&#39;totalEloChange&#39;]} | Record: ${r[&#39;wonMatchesCount&#39;]} W - ${r[&#39;lossMatchesCount&#39;]} L - ${r[&#39;drawCount&#39;]} D`)</span></span></code></pre></div><ul><li>(Fossabot) <code>!elo</code> (change BROADCASTER_MC_IGN to your Minecraft in-game name) – made by Neal</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>$(eval r=$(customapi &lt;https://mcsrranked.com/api/users/$(index1&gt; BROADCASTER_MC_IGN)); \\`stats for ${r\\[&#39;data&#39;\\]\\[&#39;nickname&#39;\\]} - elo: ${r\\[&#39;data&#39;\\]\\[&#39;elo_rate&#39;\\]} | rank: ${r\\[&#39;data&#39;\\]\\[&#39;elo_rank&#39;\\]} | record: ${r\\[&#39;data&#39;\\]\\[&#39;records&#39;\\]\\[&#39;2&#39;\\]\\[&#39;win&#39;\\]} W - ${r\\[&#39;data&#39;\\]\\[&#39;records&#39;\\]\\[&#39;2&#39;\\]\\[&#39;lose&#39;\\]} L\\`) | full leaderboard: &lt;https://mcsrranked.com/leaderboard&gt;</span></span></code></pre></div><ul><li>(Nightbot) <code>!elo</code> (requires <code>!elohelper</code>, change BROADCASTER_MC_IGN to your Minecraft in-game name) – made by Neal</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>\\-a=!elohelper $(eval \\`$(1)\\` == \\`null\\` ? \\`BROADCASTER_MC_IGN\\` : \\`$(1)\\`)</span></span></code></pre></div><ul><li>(Nightbot) <code>!elohelper</code> – made by Neal</li></ul><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>$(eval r=$(urlfetch json &lt;https://mcsrranked.com/api/users/$(1)&gt;); \\`stats for ${r\\[&#39;data&#39;\\]\\[&#39;nickname&#39;\\]} - elo: ${r\\[&#39;data&#39;\\]\\[&#39;elo_rate&#39;\\]} | rank: ${r\\[&#39;data&#39;\\]\\[&#39;elo_rank&#39;\\]} | record: ${r\\[&#39;data&#39;\\]\\[&#39;records&#39;\\]\\[&#39;2&#39;\\]\\[&#39;win&#39;\\]} W - ${r\\[&#39;data&#39;\\]\\[&#39;records&#39;\\]\\[&#39;2&#39;\\]\\[&#39;lose&#39;\\]} L\\`)</span></span></code></pre></div><h1 id="speedrunning" tabindex="-1">Speedrunning <a class="header-anchor" href="#speedrunning" aria-label="Permalink to &quot;Speedrunning&quot;">​</a></h1><h2 id="my-settings-reset-whenever-i-join-a-new-world-minecraft-exits-fullscreen-whenever-i-join-a-new-world" tabindex="-1">My settings reset whenever I join a new world / Minecraft exits fullscreen whenever I join a new world <a class="header-anchor" href="#my-settings-reset-whenever-i-join-a-new-world-minecraft-exits-fullscreen-whenever-i-join-a-new-world" aria-label="Permalink to &quot;My settings reset whenever I join a new world / Minecraft exits fullscreen whenever I join a new world&quot;">​</a></h2><p><a href="https://github.com/KingContaria/StandardSettings/releases/tag/v1.2.2" target="_blank" rel="noreferrer">StandardSettings</a> is a mod that resets your settings to specified values whenever you join a new world. You can find instructions on how to configure it <a href="https://github.com/KingContaria/StandardSettings" target="_blank" rel="noreferrer">here</a>. If you don’t want your settings to reset, remove this mod from your mods folder.</p><h2 id="entity-counter-e-counter-stays-at-1-blockentities-doesn-t-appear-when-doing-mapless-or-preemptive-navigation" tabindex="-1">Entity counter (E counter) stays at -1 / blockEntities doesn’t appear when doing mapless or preemptive navigation <a class="header-anchor" href="#entity-counter-e-counter-stays-at-1-blockentities-doesn-t-appear-when-doing-mapless-or-preemptive-navigation" aria-label="Permalink to &quot;Entity counter (E counter) stays at -1 / blockEntities doesn’t appear when doing mapless or preemptive navigation&quot;">​</a></h2><p>Go to Options &gt; Video Settings and toggle Entity Culling off.</p><h2 id="e-ray-can-t-find-far-bastions" tabindex="-1">E-ray can’t find far bastions <a class="header-anchor" href="#e-ray-can-t-find-far-bastions" aria-label="Permalink to &quot;E-ray can’t find far bastions&quot;">​</a></h2><p>Go to Options &gt; Video Settings and set your Entity Distance to 500%.</p><h2 id="water-is-invisible-block-textures-don-t-display-properly" tabindex="-1">Water is invisible / block textures don’t display properly <a class="header-anchor" href="#water-is-invisible-block-textures-don-t-display-properly" aria-label="Permalink to &quot;Water is invisible / block textures don’t display properly&quot;">​</a></h2><p>E.g.:</p><div style="text-align:center;"><img src="'+u+'" alt="Logo" style="display:block;margin:0 auto;"></div><p>In the title screen, go to Options &gt; Click the Book &amp; Quill (top right) &gt; Sodium and disable &quot;Use Chunk Multi-Draw&quot;.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Chunk Multidraw is a Sodium option that boosts performance. On a small percentage of GPUs, it will cause this issue, so you will have to disable it if you’re having this issue.</p></div><h2 id="i-can-t-increase-my-render-distance-beyond-16-or-some-other-number" tabindex="-1">I can’t increase my render distance beyond 16 (or some other number) <a class="header-anchor" href="#i-can-t-increase-my-render-distance-beyond-16-or-some-other-number" aria-label="Permalink to &quot;I can’t increase my render distance beyond 16 (or some other number)&quot;">​</a></h2><p><a href="#allocate-ram">Allocate more RAM</a>.</p><h2 id="blocks-don-t-drop-entities-are-frozen" tabindex="-1">Blocks don’t drop / entities are frozen <a class="header-anchor" href="#blocks-don-t-drop-entities-are-frozen" aria-label="Permalink to &quot;Blocks don’t drop / entities are frozen&quot;">​</a></h2><p>(also referred to as an “internal server crash”; it&#39;s in this section because the game doesn’t force quit like most crashes)</p><p>This is known as a ghost nether or phantom nether, and usually occurs when you change dimensions. Once you get this, there’s nothing you can do about it, since you’ve basically crashed (so you’ll need to restart Minecraft).</p><p>You can help us determine the cause of this issue. If you experience this, paste your <a href="#crashes">log file</a> in #bug-report in the <a href="https://discord.gg/nnjUSyDErj" target="_blank" rel="noreferrer">Ranked discord server</a>.</p><h2 id="i-was-teleported-immediately-after-entering-the-nether-and-took-some-fall-damage-can-t-find-my-nether-portal" tabindex="-1">I was teleported immediately after entering the nether (and took some fall damage / can&#39;t find my nether portal) <a class="header-anchor" href="#i-was-teleported-immediately-after-entering-the-nether-and-took-some-fall-damage-can-t-find-my-nether-portal" aria-label="Permalink to &quot;I was teleported immediately after entering the nether (and took some fall damage / can&#39;t find my nether portal)&quot;">​</a></h2><p>You were likely nether-bonked. This is when the game forgets to divide your coordinates by 8 when putting you in the nether from the overworld. It’s caused by going through a nether portal while left-clicking, so don’t hold down left-click at the time the portal animation finishes.</p><h2 id="ninjabrainbot-appears-like-a-zip-file-double-clicking-it-doesn-t-run-it" tabindex="-1">Ninjabrainbot appears like a zip file, double-clicking it doesn’t run it <a class="header-anchor" href="#ninjabrainbot-appears-like-a-zip-file-double-clicking-it-doesn-t-run-it" aria-label="Permalink to &quot;Ninjabrainbot appears like a zip file, double-clicking it doesn’t run it&quot;">​</a></h2><p><a href="https://adoptium.net/temurin/releases/" target="_blank" rel="noreferrer">Install Java</a> if you haven’t already done so. If you already have java, download and run <a href="https://johann.loefflmann.net/en/software/jarfix/index.html" target="_blank" rel="noreferrer">Jarfix</a>.</p><h2 id="i-can-t-press-f3-without-holding-fn-some-f3-keys-don-t-work" tabindex="-1">I can’t press F3 without holding Fn / some F3 keys don’t work <a class="header-anchor" href="#i-can-t-press-f3-without-holding-fn-some-f3-keys-don-t-work" aria-label="Permalink to &quot;I can’t press F3 without holding Fn / some F3 keys don’t work&quot;">​</a></h2><p>Figure out a way to <a href="https://mspoweruser.com/different-ways-to-lock-and-unlock-fn-key-in-windows-10-and-11/" target="_blank" rel="noreferrer">toggle Fn-lock on your pc</a>. If you’re on a Lenovo, the setting is in Lenovo Vantage &gt; Device &gt; Input &amp; Accessories &gt; Select F1-F12 function.</p><h2 id="how-do-i-access-the-timer-settings" tabindex="-1">How do I access the timer settings? <a class="header-anchor" href="#how-do-i-access-the-timer-settings" aria-label="Permalink to &quot;How do I access the timer settings?&quot;">​</a></h2><p>Go to Options -&gt; Click the Book &amp; Quill (top right) -&gt; SpeedRunIGT.</p><h2 id="can-i-practice-seeds-filtered-with-this-mod" tabindex="-1">Can I practice seeds filtered with this mod? <a class="header-anchor" href="#can-i-practice-seeds-filtered-with-this-mod" aria-label="Permalink to &quot;Can I practice seeds filtered with this mod?&quot;">​</a></h2><p>You’ll have to practice by playing in matches (ranked, casual, or private rooms), or by recreating worlds saved to singleplayer (i.e. seeds you have played in previous matches).</p><h1 id="crashes" tabindex="-1">Crashes <a class="header-anchor" href="#crashes" aria-label="Permalink to &quot;Crashes {#crashes}&quot;">​</a></h1><p>If Minecraft crashes, you should send the log file and/or the crash report in #tech-help (in the <a href="https://discord.gg/nnjUSyDErj" target="_blank" rel="noreferrer">Ranked discord server</a>).</p><ul><li>If you’re on Prism or MultiMC, a console window will open when the game crashes. Click “Upload” to upload the log to a paste.ee/mclo.gs link, then copy the link and send it in #tech-help. It will contain both latest.log and the crash report, as well as more additional information:</li></ul><div style="text-align:center;"><img src="https://i.imgur.com/MfrJwcM.png" alt="Logo" width="500" style="display:block;margin:0 auto;"></div><ul><li>If you’re on a different launcher, <a href="#find-minecraft">go to your .minecraft folder</a> &gt; logs and select latest.log. Send this file in #tech-help:</li></ul><div style="text-align:center;"><img src="'+p+'" alt="Logo" width="500" style="display:block;margin:0 auto;"></div><ul><li>The crash report can sometimes be found in .minecraft/crash-reports, with the date of the crash in its file name. It contains a little more information about the crash itself, but the log file is usually sufficient to diagnose issues.</li><li>If there’s an error message, sending a screenshot of that would be helpful too, in case there isn’t a crash report generated.</li></ul><p>The following sections will go through common crashes. “Symptoms” means things to look for if you’re not sure what crash it is.</p><h2 id="outdated-java-version" tabindex="-1">Outdated Java version <a class="header-anchor" href="#outdated-java-version" aria-label="Permalink to &quot;Outdated Java version&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“Java is version 1.8” under “Checking Java version…”</li><li>“- java 8” under “Loading mods”</li><li>“UnsupportedClassVersionError” followed by “has been compiled by a more recent version of the Java Runtime”</li></ul><p>Explanation:</p><ul><li>Old versions of some mods and some practice mods require newer versions of Java than the version bundled with the game.</li></ul><p>Fix:</p><ul><li>Update Java by following the steps linked <a href="#update-java">here</a>.</li></ul><h2 id="_32-bit-java" tabindex="-1">32-bit Java <a class="header-anchor" href="#_32-bit-java" aria-label="Permalink to &quot;32-bit Java&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“Error occurred during initialization of VM” followed by “Could not reserve enough space for [memory allocated] object heap”</li></ul><p>Explanation:</p><ul><li>You can’t allocate RAM above a certain amount if you use 32-bit Java.</li></ul><p>Fix:</p><ul><li><a href="#update-java">Update Java to a 64-bit version</a>.</li></ul><h2 id="javacheck-jar-on-default-launcher-and-prism-launcher" tabindex="-1">JavaCheck.jar (on default launcher and Prism Launcher) <a class="header-anchor" href="#javacheck-jar-on-default-launcher-and-prism-launcher" aria-label="Permalink to &quot;JavaCheck.jar (on default launcher and Prism Launcher)&quot;">​</a></h2><p>Symptoms:</p><ul><li>In the default launcher: Error message mentioning “Your Java Runtime is incompatible. Please edit your installation to use the bundled Java Runtime. Name: Java version mismatch”</li></ul><div style="text-align:center;"><img src="'+m+'" alt="Logo" width="500" style="display:block;margin:0 auto;"></div><ul><li>In Prism launcher: “This instance is not compatible with Java version…”</li></ul><p>Explanation:</p><ul><li>Minecraft doesn’t like it when you change your java version.</li></ul><p>Fix (default launcher):</p><ul><li>Watch <a href="https://youtu.be/HEtqR74M-_w" target="_blank" rel="noreferrer">this video</a>. Read the pinned comment if you’re on the Windows store version of the launcher. You’ll have to do this every time the launcher updates.</li></ul><p>Fix (Prism Launcher):</p><ul><li>Go to Settings &gt; Java &gt; enable Skip Java compatibility checks.</li></ul><h2 id="incompatible-mods-outdated-mods-or-mods-with-dependencies" tabindex="-1">Incompatible mods, outdated mods, or mods with dependencies <a class="header-anchor" href="#incompatible-mods-outdated-mods-or-mods-with-dependencies" aria-label="Permalink to &quot;Incompatible mods, outdated mods, or mods with dependencies&quot;">​</a></h2><p>Symptoms:</p><ul><li>Error message mentioning “Incompatible mod set found!”, followed by a list of mods stating they are “not whitelisted”</li></ul><p>Explanation:</p><ul><li>The ranked mod is only compatible with specific whitelisted mods to prevent cheating, and only specific versions of these mods are whitelisted. See the <a href="https://mods.tildejustin.dev" target="_blank" rel="noreferrer">list of allowed mods</a> for more details.</li></ul><p>Fix:</p><ul><li>Refer to the error message; it will tell you which mods are not whitelisted and whether a different version of a mod you’re using is whitelisted. Remove the mods that are not whitelisted and <a href="https://mods.tildejustin.dev/" target="_blank" rel="noreferrer">update</a> the mods that the error message tells you to update.</li><li>If you are still confused, it&#39;s possible that some mods just recently got updated and haven&#39;t been updated yet. Feel free to send a screenshot of the error message in #tech-help for help.</li></ul><h2 id="too-little-ram-allocated-usually-only-on-multimc" tabindex="-1">Too little RAM allocated (usually only on MultiMC) <a class="header-anchor" href="#too-little-ram-allocated-usually-only-on-multimc" aria-label="Permalink to &quot;Too little RAM allocated (usually only on MultiMC)&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“OutOfMemoryError: Java heap space” (This error may also indicate a memory leak. Check your RAM allocation to determine which is more likely.)</li></ul><p>Symptoms in the crash report:</p><ul><li>In “Memory” under “System Details”, there are three numbers in brackets. If the latter two are “1024 MB” or any number less than 1900 MB*, you may have this issue. <ul><li>*If you are using Shenandoah GC and know what you are doing, having a lower memory allocation is fine, as long as it’s not too low (&lt;1200 MB)</li></ul></li></ul><p>Explanation:</p><ul><li>By default, MultiMC allocates 1024 MB of RAM to Minecraft. This was sufficient for Minecraft versions before 1.13, but for anything after that, 1024 MB is too low. It should be set to somewhere from 2000 MB to 3000 MB, <a href="https://vazkii.net/blog_archive/%22%20%5Cl%20%22blog/ram-explanation" target="_blank" rel="noreferrer">but not too high</a>. You only really need a high RAM allocation (2800-3000) if you play on 32 render distance (possibly because you’re speedrunning All Advancements).</li></ul><p>Fix:</p><ul><li><a href="#allocate-ram">Allocate more RAM to Minecraft</a>.</li></ul><h2 id="onedrive-usually-only-on-multimc" tabindex="-1">OneDrive (usually only on MultiMC) <a class="header-anchor" href="#onedrive-usually-only-on-multimc" aria-label="Permalink to &quot;OneDrive (usually only on MultiMC)&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“OneDrive” mentioned basically anywhere</li></ul><p>Explanation:</p><ul><li>This occurs when your launcher folder is located in OneDrive while OneDrive is enabled. OneDrive can mess with your game files to save space, and this can to issues.</li></ul><p>Fix:</p><ul><li>Move your launcher folder outside OneDrive, for example to &quot;C:/MultiMC&quot;. If you want to unlink OneDrive, follow <a href="https://support.microsoft.com/en-au/office/turn-off-disable-or-uninstall-onedrive-f32a17ce-3336-40fe-9c38-6efb09f944b0" target="_blank" rel="noreferrer">this link</a>.</li></ul><h2 id="memory-leak-occurs-more-frequently-for-macos-users" tabindex="-1">Memory leak (occurs more frequently for macOS users) <a class="header-anchor" href="#memory-leak-occurs-more-frequently-for-macos-users" aria-label="Permalink to &quot;Memory leak (occurs more frequently for macOS users)&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“OutOfMemoryError” (This error may also be caused by allocating too little RAM. Check your RAM allocation to determine which is more likely.)</li><li>“There is insufficient memory for the Java Runtime Environment to continue”</li></ul><p>Other symptoms:</p><ul><li>Minecraft using abnormally high RAM before the crash (check your task manager)</li></ul><p>Explanation:</p><ul><li>Memory leaks occur when memory which is no longer needed is not released. Most commonly (in 1.16.1), the newest version of Sodium has a memory leak on macOS.</li></ul><p>Fix:</p><ul><li>Assuming the memory leak is caused by Sodium, replace Sodium with a version downloaded from <a href="https://mods.tildejustin.dev/" target="_blank" rel="noreferrer">this website</a> after selecting Mac.</li></ul><h2 id="resizing-the-window-to-a-large-height" tabindex="-1">Resizing the window to a large height <a class="header-anchor" href="#resizing-the-window-to-a-large-height" aria-label="Permalink to &quot;Resizing the window to a large height&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>&quot;java.lang.RuntimeException: GL_FRAMEBUFFER_INCOMPLETE_ATTACHMENT&quot;</li></ul><p>Explanation:</p><ul><li>Depending on your hardware, resizing the Minecraft window past a certain height will make it crash.</li></ul><p>Fix:</p><ul><li>If you&#39;re using Jingle for it, reduce the height in Jingle -&gt; Scripts -&gt; Resizing.</li></ul><h2 id="jvm-crash" tabindex="-1">JVM crash <a class="header-anchor" href="#jvm-crash" aria-label="Permalink to &quot;JVM crash&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“A fatal error has been detected by the Java Runtime Environment” followed by “EXCEPTION_ACCESS_VIOLATION”</li><li>“.minecraft\\hs_err_pid&lt;id&gt;.log”, where &lt;id&gt; is a few numbers</li></ul><p>Other symptoms:</p><ul><li>A separate log file named hs_err_pid&lt;id&gt;.log (where &lt;id&gt; is a few numbers) appears in your .minecraft folder. This file technically has more information about the crash but no one can read it.</li></ul><p>Explanation and fix: this crash may be caused by one of the following –</p><ul><li>Concurrently running programs, such as OBS and Discord, that use the same graphics card as the game. <ul><li>Try using window capture instead of game capture in OBS.</li><li>Try disabling hardware acceleration in Discord.</li><li>If you&#39;re on a laptop, <a href="#use-dgpu">make sure</a> Minecraft is using the dedicated GPU if you have one.</li></ul></li><li>A compatibility issue between SpeedrunIGT, Intel Graphics and OpenGL. Enable “safe font mode” in SpeedrunIGT options. If the game crashes before you can access that menu, delete .minecraft/speedrunigt.</li><li>Driver issues. Check if your drivers are updated, and update them or downgrade them if they&#39;re already updated.</li></ul><p>Generally, JVM crashes are difficult to diagnose, so there&#39;s not much we can help with if it isn&#39;t caused by one of the above issues.</p><h2 id="concurrentmodificationexception-cme" tabindex="-1">ConcurrentModificationException (CME) <a class="header-anchor" href="#concurrentmodificationexception-cme" aria-label="Permalink to &quot;ConcurrentModificationException (CME)&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“ConcurrentModificationException”, optionally accompanied with “Exception loading structure” or “StructureManager”</li></ul><p>Explanation:</p><ul><li>CMEs are rare crashes that are basically caused by RNG. There is a fix for a specific CME in StructureManager in Java 11+ (see below), which crashes with “Exception loading structure” or with a mention of “StructureManager”.</li></ul><p>Fix:</p><ul><li>Add <a href="https://github.com/modmuss50/Voyager/releases/tag/1.0.0" target="_blank" rel="noreferrer">Voyager</a> to your mods folder (you should do this regardless of whether you experienced this crash, so that future crashes may be prevented).</li></ul><h2 id="unknownhostexception" tabindex="-1">UnknownHostException <a class="header-anchor" href="#unknownhostexception" aria-label="Permalink to &quot;UnknownHostException {#unknownhostexception}&quot;">​</a></h2><p>Symptoms in the log file:</p><ul><li>“UnknownHostException: No such host is known (mcsrranked.com)”</li></ul><p>Explanation:</p><ul><li>Something on your end (network, firewall, antivirus, etc.) is blocking the ranked mod from working.</li></ul><p>Fix:</p><ul><li>Check if your firewall/antivirus is blocking mcsrranked.com.</li><li>If it’s not a firewall/antivirus issue, <a href="https://developers.google.com/speed/public-dns/docs/using%22%20%5Cl%20%22windows" target="_blank" rel="noreferrer">change your DNS provider</a> or use a VPN.</li></ul><h2 id="exit-codes" tabindex="-1">Exit codes <a class="header-anchor" href="#exit-codes" aria-label="Permalink to &quot;Exit codes&quot;">​</a></h2><p>Exit codes in log files usually aren’t sufficient to diagnose the problem.</p>',205)])])}const I=t(f,[["render",g]]);export{M as __pageData,I as default};
